package test;

public class SampleE {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//factorial pgm using do while 
		
		
		int fact=5;
		int result=1;
		
		int a=1;
		do {
			result=result*fact;
			System.out.println(result);
			a=a+1;
		}
		while(a<=5);

	}

}
